class Character extends React.Component {
    constructor(){
        super()
        this.state = {

        }
    }

    render(){
        return(
            <div className="column left">
                <div>
                    <table className="CharacterTable" cellSpacing="10">
                        <tbody>
                            <tr>
                                <td>{props.firstChar.name}</td>
                            </tr>
                            <tr>
                                <td>{props.firstChar.gender}</td>
                            </tr>
                            <tr>
                                <td>{props.firstChar.birth_year === "unknown" ? "\u00a0" : props.firstChar.birth_year}</td>
                            </tr>
                            <tr>
                                <td>{props.firstChar.hair_color}</td>
                            </tr>
                            <tr>
                                <td>{props.firstChar.mass === "unknown" ? "\u00a0" : props.firstChar.mass}</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}

export default Character
